import React from 'react';
import axios from 'axios'

const userBaseUrl = axios.create({
    baseURL: "https://localhost:5001/"
});

const readUserUrl = userBaseUrl.get("User")
class userService {
    //CREATE
    async createUsers(){
        var result = await userBaseUrl.post("User");
        console.log(result.data);
        return result.data;
    }

    // READ
    async getUsers(){
        var result = await userBaseUrl.get("User");
        console.log(result.data);
        return result.data;
    }


    // UPDATE
    async updateUsers(){
        var result = await userBaseUrl.put("User");
        console.log(result.data);
        return result.data;
    }

    //DELETE
    async deleteUser(id){
        var result = await userBaseUrl.delete(`User?id=${id}`)
        console.log(result.data);
        return result.data;
    }
}

var userCRUDService = new userService();
export default userCRUDService
